import React, { Component } from "react";
import "./Profile.css"; // Importez le fichier CSS pour les styles supplémentaires

class Profile extends Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div className="container-fluid py-5">
                <div className="profile-img-wrapper">
                    {/* Utilisez une div pour appliquer le dégradé */}
                    <div className="profile-img-gradient"></div>
                    {/* Utilisez l'image avec une classe CSS spécifique pour appliquer les styles */}
                    <img alt="" className="coverimg" src="images/coverimg.png" />
                </div>
            </div>
        );
    }
}

export default Profile;
